}

.boxSelectUnit.cbx .listUnits .itemSelectUnit .info .amount .number {
    display: block;
    width: 100%;
}

.boxSelectUnit .listUnits .itemSelectUnit {
    padding: 10px 11px;
    height: 74px;
    color: #fff;
    border-bottom: 1px solid #142C37;
    width: 100%;
    position: relative;
    cursor: pointer;
    display: flex;
}

.boxSelectUnit .listUnits .itemSelectUnit:hover {
    background-color: #313131;
}


.boxSelectUnit.cbx .listUnits {
    top: 40px;
}

.boxSelectUnit .listUnits {
    border: 1px solid #777777;
    background: transparent;
    border-top: none;
    display: none;
    position: absolute;
    top: 74px;
    left: 0px;
    width: 100%;
    z-index: 9;
    border-radius: 0px 0px 10px 10px;
    overflow: hidden;
    background: #011122;
}

.boxSelectUnit.cbx.activeSelectItem .listUnits {
    display: block;
}

.deposit_widthdraw .depos{
    display: none;
}

.button {
    cursor: pointer;
    border: none;
    background: none;
    position: relative;
    -webkit-transition: all .3s ease;
    transition: all .3s ease;
    font-weight: 700!important;
    text-decoration: none;
}

.deposit_widthdraw .listTab{
    display: -webkit-box;
    display: -ms-flexbox;
    display: flex;
    border-bottom: 1px solid #6b6b6b;
    background: transparent;
}

.deposit_widthdraw .listTab .itemTab.active {
    font-weight: 700;
    position: relative;
}

.deposit_widthdraw .listTab .itemTab {
    width: 50%;
    height: 100%;
    text-align: center;
    background: transparent;
    font-size: 16px;
    line-height: 48px;
    font-weight: 400;
    cursor: pointer;
}

.deposit_widthdraw .listTab .itemTab.active:before {
    content: "";
    height: 4px;
    width: 160px;
    background: #fa2843;
    border-radius: 3px 3px 0 0;
    display: block;
    position: absolute;
    bottom: -1px;
    left: 50%;
    margin-left: -80px;
}

.deposit_widthdraw .listTab .itemTab.active span {
    color: #fff;
}

.deposit_widthdraw .boxModal .mainBoxModal {
    padding: 20px!important;
}

.deposit_widthdraw .combo .listBalance {
    margin: 0;
}

.deposit_widthdraw .deposit_widthdraw_box .form-control {
    color: #fff;
    border: 1px solid hsla(0,0%,100%,.23);
    border-radius: 8px;
    height: 46px!important;
    line-height: 46px!important;
    margin-bottom: 0!important;
    padding: 0 10px;
}

.transfer-network-item--bsc .transfer-network-item-fee {
    color: #fedd3c !important;
    text-transform: uppercase;
    font-weight: 700;
}


.boxSelectUnit {
    height: 40px;
    border-radius: 5px;
    position: relative;
}

.borderSecondary2 {
    border: 1px solid;
    border-color: #fa2843;
}

.boxAddress,
.transfer-network {
    overflow: hidden;
}

.address .greenButton {
    background: #23c15f !important;
}

.boxAddress .address button {
    width: 230px;
}

.address .buttonCommon {
    text-align: center;
    border-radius: 5px;
    color: #fff;
    height: 47px;
    padding: 11px 15px;
    line-height: 19px;
    font-weight: 700;
    font-weight: 16px;
    border: none;
    -webkit-transition: all .3s ease;
    transition: all .3s ease;
    outline: none;
}

.boxAddress h4.colorSecondary2 {
    background: #111111;
    font-size: 12px;
    line-height: 14px;
    color: #778e9f;
    font-weight: 400;
    margin: 0;
    position: absolute;
    top: -6px;
    left: 30px;
    padding: 0 6px;
}

.boxAddress input {
    font-size: 14px;
    border: 1px solid #2f3342;
    border-radius: 8px;
    width: 100%;
    height: 40px;
    line-height: 40px;
}

.boxAddress .form-group {
    margin-bottom: 20px;
}

.boxAddress .btn.sendMax, 
.boxAddress .paste {
    position: absolute;
    right: 14px;
    -webkit-transform: translateY(-50%);
    transform: translateY(-50%);
}

.boxAddress .btn.sendMax {
    top: 50%;
    color: #fff;
    background-color: #fa2843;
    padding: 7px 10px;
    border-radius: 5px;
}

.boxAddress .noted {
    color: #fff;
    display: block;
    font-style: italic;
    padding: 10px;
}

.boxQRCode {
    margin-bottom: 20px;
}

.transfer-network-item.is-active:before {
    content: "";
    display: block;
    width: 17px;
    height: 17px;
    background: url(data:image/png;base64,) 0 0 no-repeat;
    position: absolute;
    top: -5px;
    right: -5px;
}

.transfer-network-item-label {
    font-size: 12px;
    line-height: 13px;
    margin-bottom: 2px;
    font-weight: 700;
}

.transfer-network-item.is-active .transfer-network-item-label {
    color: #fff;
    font-weight: 700;
}

.transfer-network-warn {
    border-radius: 5px;
    background: rgba(240,185,11,.26);
    border: 1px solid #f0b90b;
    color: #f0b90b;
    padding: 10px 15px;
    font-size: 12px;
    line-height: 13px;
    margin-bottom: 20px;
}


.transfer-network-item {
    background: #d0c4b9;
    border: 1px solid #9f9085;
    border-radius: 6px;
    margin: 0 4px;
    padding: 9px 0;
    color: #4d3434;
    display: -webkit-box;
    display: -ms-flexbox;
    display: flex;
    -webkit-box-orient: vertical;
    -webkit-box-direction: normal;
    -ms-flex-direction: column;
    flex-direction: column;
    text-align: center;
    -ms-flex-preferred-size: 50%;
    flex-basis: 50%;
    cursor: pointer;
    position: relative;
}

.deposit_widthdraw .transfer-network-item.is-active {
    background-color: #fa2843;
    border-color: #fa2843;
}

.deposit_widthdraw .transfer-network-item {
    background: #2f3342;
    border: 1px solid #2f3342;
    color: #7c7c7c;
}

.transfer-network-list--deposit {
    -webkit-box-pack: start;
    -ms-flex-pack: start;
    justify-content: start;
}

.transfer-network-list {
    display: -webkit-box;
    display: -ms-flexbox;
    display: flex;
    -webkit-box-pack: justify;
    -ms-flex-pack: justify;
    justify-content: space-between;
    margin: 0 -4px 15px;
}

.transfer-network-title {
    font-size: 12px;
